import React from 'react';
import './ContactForm.css';

const ContactForm = (props) => {
    return (
        <div className={`formContainer  ${props.display ? 'contactFormActive' : 'contactFormTransition'}`}>
            <form action="https://formspree.io/f/moqbjpjj" method="post" className='formRegister'>
                <input type="text" placeholder="Nombre" name="name" id="name" required className="input" />
                <input type="text" placeholder="Apellido" name="lastname" id="lastname" className="input" />
                <input type="email" name="email" id="email" placeholder="Email" required className="input" />
                <textarea name="mensaje" id="mensaje" cols="20" rows="5" minLength="2" maxLength="255"
                    placeholder="Mensaje" required className="input textarea"></textarea>
                <input type="submit" value="Enviar" className="submit" />
            </form>
        </div>
    );
};

export default ContactForm;

